  \"Union Slough National Wildlife Refuge, Iowa: Avian selenium study\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 9,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2014-04-24T15:04:00.725884\",\n\t\"name\": \"union-slough-national-wildlife-refuge-iowa-avian-selenium-study\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 2006 and 2007, we tested selenium concentrations
  in the eggs and nestling carcasses of tree swallows attracted to artificial nest
  boxes installed around Union Slough National Wildlife Refuge, Iowa. Nest box occupation,
  egg hatching rates, and apparent fledging rates were high. Nestling tree swallow
  accumulated selenium up to 7.56 milligrams per day as body weight. There was a trend
  of increasing selenium accumulation from the south end of the Refuge to the north
  end of the Refuge. There was statistically significant difference in selenium accumulation
  between 2006, which was a very dry year compared to 2007, which had normal water
  levels at Union Slough National Wildlife Refuge. The accumulation of selenium in
  eggs and nestlings were below toxicity effects thresholds. There were not any organ
  lesions observed for the nestling histopathology specimens. The passerine birds
  that forage on insects at Union Slough National Wildlife are currently not at risk
  from selenium exposure. In 2008, we tested aquatic sediments, cattail tubers, benthic
  macroinvertebrates, frogs, fishes, upland soils, and grasses for selenium. We used
  the results of the tissue data to conduct an ecological risk assessment. The results
  of the ecological risk assessment indicate that some species of wildlife such as
  the shorebirds that forage in mud flats of the management pools are at risk from
  selenium exposure.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
